import './main.css';
import logo from '../../img/logo.png';

function createContainer(content) {
    return(
        <div className="container">
            {content}
        </div>
    )
}

export default function MainComp() {
    const PictureLogo = <img className="my-logo" src={logo} alt="logo" />;
    

    return(
        <main>
            <PictureLogo/>
        </main>
    )
}
